import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import HelloWorld from './App'

function index() {
  return (
    ReactDOM.render(
          'div',
          null,
          React.createElement(HelloWorld, {'id': 1, 'framework':'Django', 'title': 'The best web framework from back-end'}),
          React.createElement(HelloWorld, {'id': 2, 'framework': 'React', 'title': 'The best framework from front-end'}),
          React.createElement(HelloWorld, {'id': 3, 'framework': 'flask', 'title': 'This is sheet framework'}),
    document.getElementById('root')
    )
  );
}
// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
index();
reportWebVitals();
